import React from 'react';
import Typing from 'react-typing-animation';

const Intro = () => {
    return (
        <div>
            <Typing
                speed= {100}>
                <span>이 설문은 영국에서 시작되어 ...</span>
                <Typing.Delay ms={100}/>
                <Typing.Backspace speed ={50} count= {19}/>
                <span>당신의 취향을 알아볼 준비가 되셨나요?</span>
            </Typing>
        </div>
    );
};

export default Intro;
